        static void TrySomeEdgeSwapping()
        {
            Randomizer rand = new Randomizer();
            BaGraph g = new BaGraph(7, rand, 700);
            int totalSwaps = 0;
            double startingAssort = g.GraphAssortativity;
            string lastDegreeSeq = String.Join(" | ",
                g.DegreeCountDictionary.OrderBy(kvp => kvp.Key).Select(kvp => kvp.Key + ":" + kvp.Value));
            string nextDegreeSeq;
            for (int i = 0; i < 15000; i++)
            {
                nextDegreeSeq = String.Join(" | ",
                    g.DegreeCountDictionary.OrderBy(kvp => kvp.Key).Select(kvp => kvp.Key + ":" + kvp.Value));
                Console.WriteLine(nextDegreeSeq);
                Console.WriteLine($"Assort: {g.GraphAssortativity}, v2: {g.GraphAssortativity2()}");
                bool b = g.SwapRandomEdgesToIncreaseAssortativity();
                if (b) totalSwaps++;
                Console.WriteLine(b ? "Swap made" : "No change");
                if (lastDegreeSeq != nextDegreeSeq)
                    throw new Exception("Holy cow");
                else
                    lastDegreeSeq = nextDegreeSeq;
            }
            Console.WriteLine($"{totalSwaps} swaps made, went from {startingAssort.ToString("##.###")} to {g.GraphAssortativity.ToString("##.###")}");
        }

