            {
                for (int i = 0; i < 15; i++)
                {
                    var tmpI = i;
                    var tmpDval = dval;
                    var seed = random.Next();

                    var t = Task.Factory.StartNew(() =>
                    {
                        BaGraph bag = new BaGraph(25, new Randomizer(new Random(seed)), 18000, tmpDval);

                        double alpha;
                        double sigma;

                        PyPowerLaw.TryPythonPowerLaw(bag.AllNodes.Select(d => d.Degree.ToString()), out alpha, out sigma);
                        string result = $"dval:\t{tmpDval}\t{tmpI})\tAlpha:\t{alpha}\tsigma:\t{sigma}";
                        lock (resultsLock)
                        {
                            results.AppendLine(result);
                        }

                        Console.WriteLine(result);
                    });
                    tasks.Add(t);
                }
            }
            tasks.ForEach(t => t.Wait());

            File.WriteAllText("results.txt", results.ToString());
            Console.WriteLine("\nAny key to continue...");
            Console.ReadKey();
        }

        static IEnumerable<int> getValsForAlpha(double alpha, int xmin = 10)
        {
            Randomizer rand = new Randomizer();
            List<int> vals = new List<int>();

            for (int i = 0; i <= 10000; i++)
            {
                vals.Add(
                    (int)(xmin * Math.Pow(1.0 - rand.NextDouble(), -1/(alpha - 1)))
                    );
            }

           
            return vals;
        }

        static void TestBaGraph()
        {
            BaGraph baGraph = new BaGraph(5, new Randomizer(), 500, 0.9);
            var groups = baGraph.AllNodes.GroupBy(n => n.Degree).OrderBy(g => g.Key);
            foreach (var g in groups)
            {
                Console.WriteLine(g.Key + ": " + g.Count());
            }
            Console.WriteLine();
        }

        static void TestErGraph()
        {
            Console.WriteLine("\n****************\n");
            ErGraph erg = new ErGraph(500, 0.25, new Randomizer());
            var groups = erg.AllNodes.GroupBy(n => n.Degree).OrderBy(g => g.Key);
            foreach (var g in groups)
            {
                Console.WriteLine(g.Key + ": " + g.Count());
            }
            Console.WriteLine();

        }
    }
